import React, { useEffect } from "react";
import "./DaisyComponents.css";
import PricingStartImage from "../assets/images/PricingStart.jpg";

function PricingStart() {
  useEffect(() => {
    // Prevent default behavior of anchor tags
    const anchorClickHandler = (event) => {
      event.preventDefault();
    };
    const anchors = document.querySelectorAll(".btn.btn-xs");
    anchors.forEach((anchor) => {
      anchor.addEventListener("click", anchorClickHandler);
    });

    // Cleanup function
    return () => {
      anchors.forEach((anchor) => {
        anchor.removeEventListener("click", anchorClickHandler);
      });
    };
  }, []);

  return (
    <div
      className="hero min-h-half bg-base-200"
      style={{
        backgroundImage: `url(${PricingStartImage})`,
      }}
    >
      <div className="hero-content text-center">
        <div className="max-w-md">
          <h1 className="text-5xl font-bold white-text">
            Which Plan Is Right For You?
          </h1>
          <p className="py-6 white-text">
            We offer an assortment of plans ranging from single sessions to
            monthly subscriptions. Each plan has unique perks!
          </p>
          <div className="carousel carousel-center max-w-md p-4 space-x-4 rounded-box">
            <div id="Single" className="carousel-item">
              <div className="card w-96 bg-primary text-primary-content">
                <div className="card-body">
                  <h2 className="card-title">Single Session</h2>
                  <p>
                    Looking to see what we have to offer? A single session with
                    the professional of your choice is a great option!
                  </p>
                  <p>
                    We offer a single session that lasts one hour, for as low as
                    $50!
                  </p>
                  <div className="card-actions justify-end">
                    <button className="btn">Buy Now</button>
                  </div>
                </div>
              </div>
            </div>
            <div id="Monthly" className="carousel-item">
              <div className="card w-96 bg-primary text-primary-content">
                <div className="card-body">
                  <h2 className="card-title">Monthly Subscription</h2>
                  <p>
                    Looking to see what we have to offer? A single session with
                    the professional of your choice is a great option!
                  </p>
                  <p>
                    We offer a single session that lasts one hour, for as low as
                    $50!
                  </p>
                  <div className="card-actions justify-end">
                    <button className="btn">Buy Now</button>
                  </div>
                </div>
              </div>
            </div>
          </div>

          <div className="flex justify-center w-full py-2 gap-2">
            <a href="#Single" className="btn btn-xs">
              1
            </a>
            <a href="#Monthly" className="btn btn-xs">
              2
            </a>
            <a href="#item3" className="btn btn-xs">
              3
            </a>
            <a href="#item4" className="btn btn-xs">
              4
            </a>
          </div>
        </div>
      </div>
    </div>
  );
}

export default PricingStart;
